import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <h1>Welcome to the Home Page</h1>
      <p>
        <Link to="/login">Log In</Link>
      </p>
      <p>
        <Link to="/sign-up">Sign Up</Link>
      </p>
    </div>
  );
}

export default Home;
